import './App.css';

function App() {
  return (
      <div className='back1'>
        <img src='https://media.baamboozle.com/uploads/images/41563/1588832391_459714' width={"100px"} height={"100px"} ></img>
      <div className='Box'>
        <span className='Title'>Авторизация</span>
          <div className='login_div'>
          <input type='value' required placeholder='' className='login'>
          </input>
          <span className='l'>Username</span>
          </div>

          <div className='pass_div'>
          <input type='value' required placeholder='' className='pass'>
          </input>
          <span className='line'></span>
          <span className='p'>Password</span>
          </div>

      </div>
      </div>
  );
}
export default App;
